import React, { useState } from 'react';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = () => {
    alert("Login feature not implemented yet.");
  };

  return (
    <div className="container mt-5">
      <h3>Login</h3>
      <input type="email" value={email} onChange={e => setEmail(e.target.value)} placeholder="Email" className="form-control my-2" />
      <input type="password" value={password} onChange={e => setPassword(e.target.value)} placeholder="Password" className="form-control my-2" />
      <button onClick={handleLogin} className="btn btn-primary">Login</button>
    </div>
  );
};

export default Login;
